import React, { Component } from 'react';
import { Button, Form, FormGroup, Label, Input } from 'reactstrap';

export default class FormComponent extends Component {
    render() {
        const drivers = this.props.value;
        return (
            <Form onSubmit={this.props.onSubmit}>
                <FormGroup>
                    <Label name = "Date" for="exampleDate">Date</Label>
                    <Input disabled={this.props.disabled} type="date" name="date" id="exampleDate" placeholder="date placeholder" />
                </FormGroup>
                <FormGroup>
                    <Label for="Name">Name</Label>
                    <Input type="text" name="deliveryName" id="Name" placeholder="Your name here" />
                </FormGroup>
                <FormGroup>
                    <Label for="exampleSelect">Select Driver</Label>
                    <Input type="select" name="selectDriver" id="exampleSelect">
                        <option>Select a driver</option>
                        {Object.keys(drivers).map((key, i)=>(
                            <option key={key+"hhh"} value={key}>{drivers[key].name}</option>
                        ))}
                    </Input>
                </FormGroup>
                <Button type="submit">Submit</Button>
            </Form>
        );
    }
}
